#!/usr/bin/python3

from ARS import ARS

def test_simple_eligibility():
    ars = ARS()
    ars.initialize_random_ARS(size=7)
    ars.set_reputations([79, 9, 1, 1, 1, 1, 0])
    eligibilities, total_rep = ars.trapezoidal_eligibility()

    assert total_rep == 92
    assert list(eligibilities.values()) == [27, 22, 18, 13, 8, 4], list(eligibilities.values())

    ars.set_reputations([79, 9, 1, 1, 1, 1, 1])
    eligibilities, total_rep = ars.trapezoidal_eligibility()

    assert total_rep == 93
    assert list(eligibilities.values()) == [23, 20, 16, 13, 10, 7, 4], list(eligibilities.values())

